import React, { useState, useEffect } from 'react';
import axios from 'axios';
import ListingList from './components/ListingList';
import CreateListing from './components/CreateListing';
import './App.css';

const App = () => {
  const [listings, setListings] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/listings')
      .then(response => {
        setListings(response.data);
        console.log(response.data);
      })
      .catch(error =>
        console.error('Error fetching listings: ', error)
      );
  }, []);

  const handleCreateListing = (newListing) => {
    setListings([...listings, newListing]);
    axios.post('http://localhost:5000/listings/add', newListing)
    .then(response => {
      console.log('Listing created: ', response.data);
    })
    .catch(error =>
      console.error('Error creating listing: ', error)
    );
  };

  const handleUpdateListing = (listingId, newListing) => {

  };

  const handleDeleteListing = (listingId) => {
    setListings(listings.filter(listing => listing._id !== listingId));
    axios.delete(`http://localhost:5000/listings/${listingId}`)
      .then(response => {
        console.log('Listing deleted: ', response.data);
      })
      .catch(error =>
        console.error('Error deleting listing: ', error)
      );
  };

  return (
    <div className= "container">
      <CreateListing onCreate={handleCreateListing} />
      <ListingList listings={listings}
        onUpdate={handleUpdateListing}
        onDelete={handleDeleteListing} />
    </div>
  );
};

export default App;
